export class _Card {
  private Enddate!: string | Date
  public text!: string
  public imageUrl!: string | ArrayBuffer | null

  constructor(date: string | Date, text: string, imageUrl: string | ArrayBuffer | null) {
    this.Enddate = date
    this.text = text
    this.imageUrl = imageUrl
  }
}
